import { Component } from '@angular/core';
import { AuthService } from '../services/auth.service';
import { ToastController } from '@ionic/angular';

@Component({
  selector: 'app-login',
  templateUrl: './login.page.html',
  styleUrls: ['./login.page.scss'],
})
export class LoginPage {
  email: string = '';
  password: string = '';
  showPassword: boolean = false;

  constructor(
    private authService: AuthService,
    private toastController: ToastController
  ) {}

  // Método para manejar el inicio de sesión
  async onSubmit() {
    if (this.isFormInvalid()) {
      this.showToast('Por favor, complete ambos campos.', 'danger');
      return;
    }
  
    try {
      // Intentar iniciar sesión
      await this.authService.signIn(this.email, this.password);
  
      // Si no hay errores, mostrar el toast de éxito
      this.showToast('¡Inicio de sesión exitoso!', 'success');
  
      // Limpiar el formulario solo tras un inicio exitoso
      this.resetForm();
    } catch (error) {
      // Si ocurre un error, mostrar un mensaje de error
      const errorMessage = this.getErrorMessage(error);
      this.showToast('Error al iniciar sesión: ' + errorMessage, 'danger');
    }
  }
  

  // Alternar visibilidad de la contraseña
  togglePasswordVisibility() {
    this.showPassword = !this.showPassword;
  }

  // Validación del formulario
  private isFormInvalid(): boolean {
    return !this.email.trim() || !this.password.trim();
  }

  // Restablecer el formulario
  private resetForm() {
    this.email = '';
    this.password = '';
  }

  // Obtener mensaje de error genérico
  private getErrorMessage(error: unknown): string {
    if (typeof error === 'object' && error !== null && 'message' in error) {
      return (error as Error).message;
    }
    return 'Ocurrió un error desconocido.';
  }

  // Mostrar un toast
  private async showToast(
    message: string,
    color: string = 'primary',
    duration: number = 2000
  ) {
    const toast = await this.toastController.create({
      message,
      color,
      duration,
      position: 'top',
    });
    await toast.present();
  }
}
<ion-header>
  <ion-toolbar color="dark">
    <ion-title class="ion-text-center">Iniciar Sesión</ion-title>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true" class="ion-padding ion-text-center dark-theme background">
  <div class="logo-container">
    <img src="../../../assets/img/logo.png" class="logo">
  </div>

  <form (ngSubmit)="onSubmit()">
    <!-- Campo de Correo Electrónico -->
    <ion-item class="dark-item">
      <ion-label position="stacked" class="ion-text-center">Correo Electrónico</ion-label>
      <ion-input 
        type="email" 
        [(ngModel)]="email" 
        placeholder="Escribe aquí..." 
        name="email" 
        required>
      </ion-input>
    </ion-item>

    <!-- Campo de Contraseña -->
    <ion-item class="dark-item">
      <ion-label position="stacked" class="ion-text-center">Contraseña</ion-label>
      <ion-input 
        [type]="showPassword ? 'text' : 'password'" 
        [(ngModel)]="password" 
        name="password" 
        required>
      </ion-input>
      <ion-button 
        fill="clear" 
        slot="end" 
        (click)="togglePasswordVisibility()" 
        title="Mostrar/Ocultar contraseña" 
        aria-label="Mostrar u ocultar contraseña">
        <ion-icon [name]="showPassword ? 'eye' : 'eye-off'"></ion-icon>
      </ion-button>
    </ion-item>

    <br>
    <!-- Botón de Iniciar Sesión -->
    <ion-button expand="block" type="submit" class="login-button">Iniciar Sesión</ion-button>
  </form>
</ion-content>
